header:
  fontFamily: 'sans-serif'
  fill: '#FFFFFF'
  fontSize: '12px'

about:
  fontFamily: 'monospace'
  fill: '#FFFFFF'
  fontSize: '10px'

username:
  fontFamily: 'monospace'
  fill: '#FFFFFF'
  fontSize: '24px'

stats:
  fontFamily: 'monospace'
  fill: '#FFFFFF'
  fontSize: '12px'

background:
  fill: url(#gradient)

svg: 
  pre: |
    <defs>
        <radialGradient id="gradient" cx="80%" cy="70%" r="141%" fx="80%" fy="70%">
            <stop offset="0%" style="stop-color:#ff0000">
                <animate attributeName="stop-color" values="#ff0000;#ffa500;#ffff00;#008000;#0000ff;#4b0082;#ee82ee;#40e0d0;#adff2f;#ff0000" dur="5s" repeatCount="indefinite" />
            </stop>
            <stop offset="100%" style="stop-color:#adff2f">
                <animate attributeName="stop-color" values="#adff2f;#ff0000;#ffa500;#ffff00;#008000;#0000ff;#4b0082;#ee82ee;#40e0d0;#adff2f" dur="5s" repeatCount="indefinite" />
            </stop>
        </radialGradient>
    </defs>
  post: |
    <image x="260" y="130" width="128" height="128" xlink:href="data:image/gif;base64,"/>
